import React, { useState } from 'react';
import axios from 'axios';
import '../css/PesquisarCliente.css';

const PesquisarCliente = () => {
  const [nomeCliente, setNomeCliente] = useState('');
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [visibleClientes, setVisibleClientes] = useState({});

  const pesquisarCliente = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:3333/findClienteByName?name=${nomeCliente}`);
      setData(response.data);
      console.log(response.data);
      setError(null);
    } catch (error) {
      setError(error);
      setData(null);
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (event) => {
    setNomeCliente(event.target.value);
  };

  const toggleDetails = (id) => {
    setVisibleClientes((prevVisibleClientes) => ({
      ...prevVisibleClientes,
      [id]: !prevVisibleClientes[id],
    }));
  };

  return (
    <div>
      <label>
        <span>Informe o nome do cliente: </span>
        <input value={nomeCliente} onChange={handleInputChange} name="myInput" />
      </label>
      <button onClick={pesquisarCliente}>
        Pesquisar
      </button>
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error.message}</p>}
      {data && (
        <div >
          <h2>Dados dos Clientes:</h2>
          {data.map((cliente) => (
            <div id='clientes' key={cliente.id}>
              <h2 className='nomeCliente'>{cliente.nomeCliente}</h2>
              <button onClick={() => toggleDetails(cliente.id)}>
                {visibleClientes[cliente.id] ? '-' : '+'}
              </button>
              {visibleClientes[cliente.id] && (
                <div id='clientesInformacoes'>
                  <p>Status cliente{cliente.statusCliente}</p>
                  <p>Ip Concentrador: {cliente.ipConcentrador}</p>
                  <p>{cliente.nomeConcentrador}</p>
                  <p>{cliente.latitudeCliente}</p>
                  <p>{cliente.longitudeCliente}</p>
                  <p>{cliente.conexaoInicial}</p>
                  <p>{cliente.conexaoFinal}</p>
                  <p>{cliente.tempoConectado}</p>
                  <p>{cliente.consumoDownload}</p>
                  <p>{cliente.consumoUpload}</p>
                  <p>{cliente.motivoDesconexao}</p>
                  <p>{cliente.popCliente}</p>
                  <p>{cliente.enderecoCliente}</p>
                  <p>{cliente.bairroCliente}</p>
                  <p>{cliente.cidadeCliente}</p>
                  <p>{cliente.planoContrato}</p>
                  <p>{cliente.statusInternet}</p>
                  <p>{cliente.valorPlano}</p>
                </div>
              )}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default PesquisarCliente;
